import React from 'react';
import Loading from './Components/Loading';
import styled from 'styled-components';

const App = () =>{
  return (
    <div>
      <Container>
        <Loading/>
      </Container>
    </div>
  );
}

export default App;

const Container = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  alight-items: center;
`;
